import react from 'react';
import '../css/Service.css';


function Service(){
  return (
    <react.Fragment>
      <h1 className="service">
        Service
      </h1>
      <div className="con-service">
        <div className="itm-service">
          App Development
        </div>
        <div className="itm-service">
          Web Development
        </div>
      </div>
    </react.Fragment>
  );
}

export default Service;
